import React from "react";

const LandingPage = () => {
  const myStyle = {
    background:
      "linear-gradient(0deg,rgba(21, 21, 15, 0.5),rgba(21, 21, 15, 0.3)),url(/images/loginimage.png)"
  };
  return (
    <div>
      <div style={myStyle}></div>
    </div>
  );
};

export default LandingPage;
